REPLACE INTO `group` (`id`, `name`, `info`, `modified`, `modifier`) VALUES
	(1, 'I', 'Die Gruppe 1 ist lediglich zur Führung einer Legeliste verpflichtet, in welche die täglich anfallende Eizahl einzutragen ist. Einführung der Fallnestkontrolle wird empfohlen.', '2023-03-03 16:48:15', 1),
	(2, 'II', 'Die Gruppe 2 führt eine Legeliste, Fallnest- und Eigewichtskontrolle während der Brutzeit und arbeitet mit Einzelschlupf- und Kükenkennzeichnung sowie Aufzuchtskontrolle.', '2023-03-03 16:48:13', 1),
	(3, 'III', 'Die Gruppe 3 arbeitet mit ganzjähriger Fallnest- und Eigewichtskontrolle sämtlicher Tiere, Schlupfkontrolle, Kükenkennzeichnung, Aufzuchtskontrolle und Pullorumuntersuchung. Zuchthähne nur von Althennen, die mindestens die Mindestleistung der Musterbeschreibung des BDRG erreicht haben.', '2023-03-03 16:48:58', 1);
